  const [todos, setTodos] = useState(["ToDo 1", "Todo 2"])
  return (
    <div>
      <TodoList todos={todos}></TodoList>
      <input type="text"></input>
      <button>Add to Do</button>
      <button>Clear Completed</button>
      <div>0 left to do</div>
    </div>
  )

}
export default App
